// 회원가입 페이지
const Signup = () => {
    return (
      <div>
        <h1>회원가입 페이지</h1>
        <p>회원가입 페이지입니다.</p>
        {/* 예시 */}
        <input data-testid="email-input" />
        <input data-testid="password-input" />
        <button data-testid="signup-button">회원가입</button>
      </div>
    );
  };

  export default Signup;
